package arrays;

public class ArrayExample2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s[] = new String[4];

		s[0] = "Ashish ";
		s[1] = "Shrestha";
		s[2] = "is";
		s[3] = "the Name";

		for (String i : s) {
			System.out.println(i);
		}
	}

}
